class Solution:
    def replaceNonCoprimes(self, nums: List[int]) -> List[int]:
        idx = 1
        changed = False
        goBack = False
        backChanged = False
        ans = [nums[0]]

        while True:
            # print(ans)
            if idx == len(nums):
                if not changed:
                    break
                else:
                    goBack = True
            if not goBack:  # go forward
                d = gcd(ans[-1], nums[idx])
                if d > 1:
                    ans[-1] = ans[-1] * nums[idx] // d
                    changed = True
                    idx += 1
                else:
                    if not changed:
                        ans.append(nums[idx])
                        idx += 1
                    else:
                        goBack = True
            else: # go back
                if len(ans) == 1:
                    changed = False
                    goBack = False
                else:
                    d = gcd(ans[-1], ans[-2])
                    if d > 1:
                        ans[-2] = ans[-1] * ans[-2] // d
                        ans.pop()
                        backChanged = True
                    else:
                        goBack = False
                        changed = backChanged
                        backChanged = False

        return ans

